import React from 'react';
import { HaidilaoLogoMini } from '../../asset/images/restaurant_info/haidilao/index.js';
import { StarIcon, TimeIcon } from '../../asset/icons/box/index.js';

const InformationBox = () => {
  return (
    <div className="w-299 h-120 border border-gray-500">
      {/* Top section */}
      <div className="flex items-center p-2">
        <img src={HaidilaoLogoMini} alt="Haidilao Logo" className="w-25 h-25" />
        <h1 className="ml-2">Haidilao - Dong Khoi</h1>
      </div>
      <hr className="border border-gray-500" />
      {/* Bottom section */}
      <div className="p-2">
        {/* Case A */}
        <p className="mb-2">Table No.15</p>
        {/* Case B */}
        {/* <p className="mb-2">L3 Vincom Center, 72 Lê Thánh Tôn, P. Bến Nghé, Quận 1, TP. HCM.</p> */}
      </div>
      {/* Common elements for both cases */}
      <div className="flex items-center p-2">
        <StarIcon className="w-5 h-5" />
        <p className="ml-1">4.9 (284)</p>
        <TimeIcon className="w-5 h-5 ml-4" />
        <p className="ml-1">15-25 mins</p>
      </div>
    </div>
  );
};

export default InformationBox;
